/*Table structure for table `ed_dic_folder` */

DROP TABLE IF EXISTS `ed_dic_folder`;

CREATE TABLE `ed_dic_folder` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(128) DEFAULT NULL COMMENT '目录名称',
  `sort` int(12) DEFAULT NULL COMMENT '排序',
  `level` int(12) DEFAULT NULL COMMENT '层级',
  `parent_code` varchar(128) DEFAULT NULL COMMENT '父编码',
  `case_type` varchar(64) DEFAULT NULL,
  `dossier_id` int(12) DEFAULT NULL COMMENT '收案ID',
  `code` varchar(255) DEFAULT NULL COMMENT '内部编码 唯一键',
  PRIMARY KEY (`id`),
  KEY `index_code` (`code`) USING BTREE,
  KEY `index_name` (`name`) USING BTREE,
  KEY `index_caseType` (`case_type`) USING BTREE
