/*Table structure for table `ed_dic_folder_mapping` */

DROP TABLE IF EXISTS `ed_dic_folder_mapping`;

CREATE TABLE `ed_dic_folder_mapping` (
  `id` int(32) NOT NULL AUTO_INCREMENT,
  `maping_name` varchar(255) DEFAULT NULL COMMENT '抽象标题',
  `folder_name` varchar(255) DEFAULT NULL COMMENT '文件夹名称',
  `is_main` int(1) NOT NULL DEFAULT '0' COMMENT '是否为正卷规则（1:是；0:否），0表示为副卷规则',
  `case_type` varchar(100) DEFAULT NULL COMMENT '案件类型',
  `sort` int(11) DEFAULT NULL COMMENT '映射到同一目录规则下的顺序',
  PRIMARY KEY (`id`),
  KEY `sindex` (`maping_name`,`folder_name`,`is_main`,`case_type`)
