/*Table structure for table `ed_dictionary` */

DROP TABLE IF EXISTS `ed_dictionary`;

CREATE TABLE `ed_dictionary` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(64) DEFAULT NULL COMMENT '字典编码 唯一键',
  `name` varchar(255) DEFAULT NULL COMMENT '字典名称',
  `sort` int(10) DEFAULT NULL COMMENT '排序',
  `level` int(12) DEFAULT NULL COMMENT '层级',
  `parent_code` varchar(64) DEFAULT NULL COMMENT '父编码',
  `extend` varchar(255) DEFAULT NULL COMMENT '扩展字段',
  `remark` varchar(255) DEFAULT NULL COMMENT '系统字典表',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

