DROP TABLE IF EXISTS `ed_dossier`;

CREATE TABLE `ed_dossier` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dossier_no` varchar(255) DEFAULT NULL COMMENT '收案号 唯一键',
  `commit_time` datetime DEFAULT NULL COMMENT '提交时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `created_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `updated_by` varchar(64) DEFAULT NULL COMMENT '更新人',
  `catalog_status` int(3) DEFAULT NULL COMMENT '任务状态 1、等待处理；2、处理中；3、已完成；4、处理失败',
  `operator` varchar(64) DEFAULT NULL COMMENT '经办人',
  `dossier_name` varchar(255) DEFAULT NULL COMMENT '收案号如果被urlencode,这个是解码后的明文',
  `create_type` int(11) DEFAULT NULL COMMENT '创建类型 1、扫描；2、接口；3、上传;4、不编目展示编目结果；5、蝴蝶页扫描；6、蝴蝶页上传',
  `callback` varchar(512) DEFAULT NULL COMMENT '回调地址',
  `is_deleted` int(11) DEFAULT '0' COMMENT '是否删除 0否1是',
  `case_type` varchar(64) DEFAULT NULL COMMENT '案件类型code',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `case_no` varchar(255) DEFAULT NULL COMMENT '案件号（立案号）',
  `litigant` varchar(500) DEFAULT NULL COMMENT '当事人',
  `case_cause` varchar(255) DEFAULT NULL COMMENT '案由',
  `skip_catalog` int(11) DEFAULT '0' COMMENT '是否跳过编目 0否1是',
  `batch_no` int(11) DEFAULT NULL COMMENT '批次号(苏州中院)',
  PRIMARY KEY (`id`),
  KEY `dossier_no_index` (`dossier_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=77519 DEFAULT CHARSET=utf8;

/*Data for the table `ed_dossier` */

/*Table structure for table `ed_file` */

DROP TABLE IF EXISTS `ed_file`;

CREATE TABLE `ed_file` (
  `id` varchar(255) NOT NULL,
  `dossier_id` int(11) DEFAULT NULL COMMENT '收案ID',
  `name` varchar(512) DEFAULT NULL COMMENT '文件名',
  `manual_name` varchar(512) DEFAULT NULL COMMENT '人工识别文件名',
  `ocr_select_name` varchar(255) DEFAULT NULL COMMENT 'ocr框选识别标题(标注结果)',
  `cont_name` varchar(255) DEFAULT NULL COMMENT '系统识别标题',
  `format` varchar(16) DEFAULT NULL COMMENT '文件格式',
  `path` varchar(255) DEFAULT NULL COMMENT 'fdfs路径',
  `type` int(11) DEFAULT NULL COMMENT '1文件2文件夹3doc(苏中院)',
  `is_ocr` int(11) DEFAULT NULL COMMENT '是否ocr处理过，不管成功失败（0否1是）',
  `parent_code` varchar(64) DEFAULT NULL COMMENT '对应归目后的所属目录',
  `parent_id` varchar(255) DEFAULT NULL COMMENT '对应所属文件夹',
  `sort` decimal(16,4) DEFAULT NULL COMMENT '卷宗内排序',
  `file_no` int(11) DEFAULT NULL COMMENT 'catalog文件内排序',
  `manual_file_no` int(11) DEFAULT NULL COMMENT '人工操作文件内排序',
  `image_id` varchar(64) DEFAULT NULL COMMENT '第三方文件ID',
  `image_path` varchar(512) DEFAULT NULL COMMENT '第三方图片地址',
  `image_sort` int(11) DEFAULT NULL COMMENT '第三方排序',
  `ocr_res` varchar(255) DEFAULT NULL COMMENT 'ocr结果',
  `ocr_text` longtext COMMENT 'ocr拼接文字',
  `cont_res` varchar(255) DEFAULT NULL COMMENT '编目结果',
  `elle_res` varchar(255) DEFAULT NULL COMMENT '语义抽取结果',
  `file_size` int(11) DEFAULT NULL COMMENT '文件大小',
  `ocr_time` int(11) DEFAULT NULL COMMENT 'ocr耗时',
  `width` int(11) DEFAULT NULL COMMENT '图片宽',
  `height` int(11) DEFAULT NULL COMMENT '图片长',
  `is_update` int(11) DEFAULT NULL COMMENT '是否人工修改过，0否1是',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `rotate` int(3) DEFAULT '0' COMMENT '旋转角度',
  `com_path` varchar(255) DEFAULT NULL COMMENT '压缩图片的path',
  `batch_no` int(8) DEFAULT '1' COMMENT '批次号',
  `bies` varchar(10) DEFAULT NULL COMMENT '机器编目的B、I、E、S顺序',
  `ocr_selected_json` text COMMENT '标注结果',
  `is_butterfly` int(11) DEFAULT NULL COMMENT '是否是蝴蝶页',
  `can_edit` int(1) DEFAULT '0' COMMENT '0表示可编辑，1表示不可编辑 ',
  `source_id` varchar(255) DEFAULT NULL COMMENT '原始文档id',
  `is_blank` int(11) DEFAULT '0' COMMENT '是否空白页 0否1是',
  `is_delete` int(11) DEFAULT '0' COMMENT '是否删除 0否1是',
  `litigant_attribute` varchar(255) DEFAULT NULL COMMENT '当事人属性',
  `pdf_path` varchar(255) DEFAULT NULL COMMENT '双层pdf fdfs路径',
  PRIMARY KEY (`id`),
  KEY `index_dossierId` (`dossier_id`) USING BTREE,
  KEY `index_pid` (`parent_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

